import React from 'react';
import './App.css';
import HomePage from '../src/pages/home-page/homepage.component';

import { Switch, Route } from 'react-router-dom';

const HatPage = () => (
  <div>
	<h1>Hats Page</h1>
  </div>
);

function App() {
  return (
	<div className="App">
			<Route exact path='/' component={HomePage} />
			<Route exact path='/hats' component={HatPage} />

    </div>
  );
}

export default App;
